const SEND_MESSAGE = 'SEND-MESSAGE'
const UPGRADE_DIALOG_BODY = 'UPGRADE-DIALOG-BODY'

let defaultVal = {
    dialogsData: [
        { id: 1, userName: 'Leon', avatar : 'data:image/jpeg;base64,' },
        { id: 2, userName: 'Sasha', avatar: 'data:image/jpeg;base64,' , },
        { id: 3, userName: 'Dog', avatar: 'data:image/jpeg;base64,' , },
        { id: 4, userName: 'Cat', avatar: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSdmuUj73Y2X95kaEZC8mUoRoVBS_y3GrUOEQ&usqp=CAU' , },
    ],

    messagesData: [
        { id: 1, message: 'Hello,leon' },
        { id: 2, message: 'Hello,Sasha' },
        { id: 3, message: 'Hello,Dog' },
        { id: 4, message: 'Cat' },
    ],

    newMessage : ''

}


export const dialogsReducer = (state = defaultVal, action) => {
    switch (action.type) {
        case 'SEND-MESSAGE':
            let newMessage = { 
                id : 6, 
                message : state.newMessage
            }
            return {
                ...state,
                messagesData : [ ...state.messagesData, newMessage],
                newMessage: ''
            }
        case 'UPGRADE-DIALOG-BODY':
            return {
                ...state,
                newMessage : action.text
            }
        default : 
            return state
    }   
}

export const sendNewMessageActionCreator = () => ({type : SEND_MESSAGE})
export const upgradeDialogAreaActionCreator = (text) => ({ type : UPGRADE_DIALOG_BODY, text : text })